import wineParty from '../assets/wine_party.png';
import dollar from '../assets/dollar.png';
import meal from '../assets/diet.png';
import calendar from '../assets/calendar.png';
import Logo from './Logo';
import { Link } from 'react-router-dom';

import LoginForm from './LoginForm';
import ImageList from './ImageList';

function LandingPage() {
  let list = [
    {
      title: "Events",
      img: calendar,
      text:"Local and virtual events happening around the world so you are always in the loop."
    },
    {
      title: "Savings",
      img: dollar,
      text:"Flash wine sales and giveaways that save you money."
    },
    {
      title: "Recipes",
      img: meal,
      text:"Weekly tailored wine pairings to expand your palette."
    }
  ]
  return (
    <div className="main">
          <ul className="homeNavbarMenu">
            <Link to="#features">
              <li>
                  Features
              </li>
            </Link>
            <Link to="#pricing">
              <li>
                  Pricing
              </li>
            </Link>
            <Link to="#faq">
              <li>
                  FAQ
              </li>
            </Link>
          </ul>
      <div className="row1">
        <div className="container">
              <Logo />
              <p id="slogan">Helping you have the best wine experience wherever you are.</p>
              <LoginForm />
              {/* <ImageList list={list} /> */}
            </div>
              <img id="wineParty" src={wineParty}/>
        </div>

        <div id="features">
          <p className="sectionHeader">Features</p>
          <ImageList list={list} />

        </div>

        <div id="pricing">
          <p className="sectionHeader" class='pricing'>Pricing</p>

          Taste delicious wine faster for just 33 cents a day.
        </div>

        <div id="faq">
          <p className="sectionHeader" class='faq'>FAQ</p>

          How does it work?
        </div>

    </div>
  );
}

export default LandingPage;
